                      name:'Mehdi Tazi',  position:'Project Manager',  phone:'+212 12345678' ,  email:'Tazi@PortNet.com',  website:'TaziPortNet.com',},
                    {img:'https://media-exp1.licdn.com/dms/image/C4E03AQF66wet-wDVqw/profile-displayphoto-shrink_800_800/0/1618997736226?e=1664409600&v=beta&t=G3FUI5U9GXnswecBFQtWqlF28odkrfZL_mgLWgZ79I8', 
                      name:'Nabil Ouzir',  position:'Project Manager',  phone:'+212 12345678' ,  email:'ouzire@PortNet.com',  website:'ouzirePortNet.com',},
                    {img:'https://media-exp1.licdn.com/dms/image/C4E03AQEmKzqLsPr34Q/profile-displayphoto-shrink_800_800/0/1619036736439?e=1664409600&v=beta&t=hokn79v8jQuHmpOQteDe2u8kyFen_3jLAu1Ao8xyJJ0',  
                      name:'Said AIT BEN ALI',  position:'Senior Java JEE Developer',  phone:'+212 12345678' ,  email:'AitBenAli@PortNet.com',  website:'AitBenAliPortNet.com',},
                    {img:'https://media-exp1.licdn.com/dms/image/C4E03AQHeos4FRi0oBw/profile-displayphoto-shrink_800_800/0/1618919383510?e=1664409600&v=beta&t=AWI1hu3hTUobg1M35Y4N3ECNkxmW-RPPzv_w3VXw4os',
                      name:'Doha BOUANAN',  position:'Responsable cellule controle de gestion',  phone:'+212 12345678' ,  email:'Bouanan@PortNet.com',  website:'BouananPortNet.com',}   
                  ]
    }
  }

  mapping(x){
    const members =x.map(member => <TeamMember 
                    img ={member.img} 
                    name ={member.name}
                    position={member.position}
                    phone={member.phone}
                    email={member.email}
                    website={member.website}
              />);
    return members

  }

  render(){    
    return(
        <div className="row">
            {this.mapping(this.state.memberInfo)}
        </div>
    )
}
}

export default Team;
